export default function Navbar() {
  return (
    <div className="navbar">
      <div className="logo">Logo</div>
      <div className="menu">
        <a href="#">Home</a>
        <a href="#">About</a>
        <a href="#">Contact</a>
      </div>
    </div>
  );
}
